- uid: azure-cognitiveservices-face.LargeFaceListOperations.addFaceFromStream
  name: addFaceFromStream(string, stream.Readable, Object)
  children: []
  type: method
  langs:
  - typeScript
  summary: Ajouter une face à une liste de visages de grande taille. Le visage d’entrée est spécifié en tant qu’image avec un rectangle targetFace. Elle retourne un persistedFaceId représentant la face ajoutée et persistedFaceId n’expirent pas.
  syntax:
    content: 'function addFaceFromStream(largeFaceListId: string, image: stream.Readable, options?: Object)'
    parameters:
    - id: largeFaceListId
      type:
      - string
      description: >
        ID de référence à une liste particulière face volumineux.
    - id: image
      type:
      - stream.Readable
      description: >
        Un flux d’image.
    - id: options
      type:
      - Object
      description: ''
      optional: true
    return:
      type:
      - Promise<azure-cognitiveservices-face.PersistedFace>
  package: azure-cognitiveservices-face
